import React from 'react';
import "./Dashboard.css";
import Sidebar from './Sidebar';
import SensorChart from './SensorChart.tsx';

function Dashboard() {
  return (
    <div className="dashboard">
      <Sidebar />
      <div className="main-content">
        <h1>Real Time Environmental Dashboard</h1>
        <div className="chart-filters">
                <label className="filter-checkbox">
                    <input
                        type="checkbox"
                        checked={filters.temperature}
                        onChange={() => handleFilterChange('temperature')}
                    />
                    Temperature
                </label>
                <label className="filter-checkbox">
                    <input
                        type="checkbox"
                        checked={filters.humidity}
                        onChange={() => handleFilterChange('humidity')}
                    />
                    Humidity
                </label>
                <label className="filter-checkbox">
                    <input
                        type="checkbox"
                        checked={filters.airQuality}
                        onChange={() => handleFilterChange('airQuality')}
                    />
                    Air Quality
                </label>
            </div>
        <div className="chart-container">
          <SensorChart />
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
